import './App.css';
import React, { Component } from "react";
import Button from "./components/CustomButtonComponent";
import history from './history';
import Routes from './Routes';
import CBased from "./CBased/CBased";
import CFiltering from "./CFiltering/CollabFiltering";
import { BrowserRouter, Route, Switch } from 'react-router-dom';

class App extends Component {

  constructor(){
    super();
    this.state = {
      token:'',
      isActive:false,
      songID:[],
      songID_str:''
    }
  }

  //showHandler = ()=>{
//       this.setState({
//           isActive: true
//       })
//   }

  CB_push = () => {
  	history.push('/CBased');
	<CBased />
  }

  render(){
    return (
      <div className="App">
        <Routes />

        <h1>Music Recommendation System Evaluation</h1>
        <p>
          Music recommendation system where users can choose which recommendation algorithm they enjoy better. 
          This app is part of my final project for my degree in data science imparted by University Pompeu Fabra.
        </p>

        <Button
          border="none"
          color="pink"
          height = "200px"
          onClick={() => this.CB_push()}
          radius = "50%"
          width = "200px"
          children = "Content Based Recommender System"
        />

        <div style={{width:"25%", display:'inline-block'}}/>

        <Button
          border="none"
          color="#9DC183"
          height = "200px"
          onClick={() => history.push('/CollabFiltering')}
          radius = "50%"
          width = "200px"
          children = "Collaborative Filtering"
        />

        <BrowserRouter>
	        <Switch>
	          <Route path="/CBased">
	            <CBased />
	          </Route>
	          <Route path="/CollabFiltering">
	            <CFiltering />
	          </Route>
	        </Switch>
      	</BrowserRouter>

      </div>
    );
  }

}

export default App;
